n    // Some comments\n    line 1 of code\n    line 2 of code\n    line 3 of code\nBlock code "fences"\n```\nSample text here...\n```\nSyntax highlighting\n``` js\nvar foo = function (bar) {\n  return bar++;\n};\nconsole.log(foo(5));\n```\n## Tables\n| Option | Description |\n| ------ | ----------- |\n| data   | path to data files to supply the data that will be passed into templates. |\n| engine | engine to be used for processing templates. Handlebars is the default. |\n| ext    | extension to be used for dest files. |\nRight aligned columns\n| Option | Description |\n| ------:| -----------:|\n| data   | path to data files to supply the data that will be passed into templates. |\n| engine | engine to be used for processing templates. Handlebars is the default. |\n| ext    | extension to be used for dest files. |\n## Links\n[link text](http://dev.nodeca.com)\n[link with title](http://nodeca.github.io/pica/demo/ "title text!")\nAutoconverted link https://github.com/nodeca/pica (enable linkify to see)\n## Images\n![Minion](https://octodex.github.com/images/minion.png)\n![Stormtroopocat](https://octodex.github.com/images/stormtroopocat.jpg "The Stormtroopocat")\nLike links, Images also have a footnote style syntax\n![Alt text][id]\nWith a reference later in the document defining the URL location:\n[id]: https://octodex.github.com/images/dojocat.jpg  "The Dojocat"\n## Plugins\nThe killer feature of `markdown-it` is very effective support of\n[syntax plugins](https://www.npmjs.org/browse/keyword/markdown-it-plugin).\n### [Emojies](https://github.com/markdown-it/markdown-it-emoji)\n> Classic markup: :wink: :crush: :cry: :tear: :laughing: :yum:\n>\n> Shortcuts (emoticons): :-) :-( 8-) ;)\nsee [how to change output](https://github.com/markdown-it/markdown-it-emoji#change-output) with twemoji.\n### [Subscript](https://github.com/markdown-it/markdown-it-sub) / [Superscript](https://github.com/markdown-it/markdown-it-sup)\n- 19^th^\n- H~2~O\n### [<ins>](https://github.com/markdown-it/markdown-it-ins)\n++Inserted text++\n### [<mark>](https://github.com/markdown-it/markdown-it-mark)\n==Marked text==\n### [Footnotes](https://github.com/markdown-it/markdown-it-footnote)\nFootnote 1 link[^first].\nFootnote 2 link[^second].\nInline footnote^[Text of inline footnote] definition.\nDuplicated footnote reference[^second].\n[^first]: Footnote **can have markup**\n    and multiple paragraphs.\n[^second]: Footnote text.\n### [Definition lists](https://github.com/markdown-it/markdown-it-deflist)\nTerm 1\n:   Definition 1\nwith lazy continuation.\nTerm 2 with *inline markup*\n:   Definition 2\n        { some code, part of Definition 2 }\n    Third paragraph of definition 2.\n_Compact style:_\nTerm 1\n  ~ Definition 1\nTerm 2\n  ~ Definition 2a\n  ~ Definition 2b\n### [Abbreviations](https://github.com/markdown-it/markdown-it-abbr)\nThis is HTML abbreviation example.\nIt converts "HTML", but keep intact partial entries like "xxxHTMLyyy" and so on.\n*[HTML]: Hyper Text Markup Language\n### [Custom containers](https://github.com/markdown-it/markdown-it-container)\n::: warning\n*here be dragons*\n:::\n',defaultConfig:{height:330,preview:!1,menu:!0,md:!0,html:!0,toolbar_show:!0}};var Be=function(e){function t(){return Object(f.a)(this,t),Object(v.a)(this,Object(b.a)(t).apply(this,arguments))}return Object(y.a)(t,e),Object(g.a)(t,[{key:"render",value:function(){var e={markConfig:{md:!1,menu:!1,toolbar_show:!1},markContent:"\n``` js\n//\u4e00\u3001\u591a\u79cd\u8d4b\u503c\u5199\u6cd5\n (event)=>this.linkMouseEnter(item,event) \n this.linkMouseEnter.bind(this,item) \n\n//\u4e8c\u3001\u4f7f\u7528\u65b9\u5f0f\n// render\u5199\u6cd5\uff0c\u4f20\u53c2\u6570\u548cevent\u5bf9\u8c61\nthis.state.arrList,map(item=>(<div onClick={(event)=>this.linkMouseEnter(item,event) }></div>))\nthis.state.arrList,map(item=>(<div onClick={ this.linkMouseEnter.bind(this,item) }></div>))\n\n// \u5b9a\u4e49\u4e8b\u4ef6\u51fd\u6570\u5199\u6cd5\nlinkMouseEnter=(item,e)=>{}\n```\n"};return